<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Document</title>
  <style>
    body {
      overflow: hidden;
      height: 100vh;
      display: flex;
      justify-content: center;
      align-items: center;
      pointer-events: none;
      user-select: none;
      font-family: 'Montserrat', ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto,
        'Helvetica Neue', Arial, 'Noto Sans', sans-serif, 'Apple Color Emoji', 'Segoe UI Emoji', 'Segoe UI Symbol',
        'Noto Color Emoji';
    }

    h1 {
      background: -webkit-linear-gradient(#dc1829, #dc8718cf);
      -webkit-background-clip: text;
      background-clip: text;
      -webkit-text-fill-color: transparent;
    }

    .card {
      width: 190px;
      height: 254px;
      transition: all 0.2s;
      position: relative;
    }

    .card-inner {
      width: inherit;
      height: inherit;
      background: rgba(255, 255, 255, .05);
      box-shadow: 0 0 10px rgba(0, 0, 0, 0.25);
      backdrop-filter: blur(38px);
      border-radius: 8px;
      transition: transform 1s ease-in-out;
    }

    .card-inner-content {
      display: flex;
      justify-content: center;
      align-items: center;
      height: 100%;
      flex-direction: column;
    }

    .card:hover {
      transform: scale(1.04) rotate(1deg);
      transition: transform 1s ease-in-out;
    }

    .circle {
      width: 100px;
      height: 100px;
      /* background: radial-gradient(#b0e633, #53ef7d); */
      background: radial-gradient(#dc8718cf, #dc1829);

      border-radius: 50%;
      position: absolute;
      opacity: 0.9;
      animation: move-up 2s ease-in infinite alternate-reverse;
    }

    .circle:nth-child(1) {
      top: -25px;
      left: -25px;
    }

    .circle:nth-child(2) {
      bottom: -25px;
      right: -25px;
      animation-name: move-down;
    }

    .pulsate-fwd {
      -webkit-animation: pulsate-fwd 2s ease-in-out infinite both;
      animation: pulsate-fwd 2s ease-in-out infinite both;
    }

    @keyframes move-up {
      to {
        transform: translateY(-10px);
      }
    }

    @keyframes move-down {
      to {
        transform: translateY(10px);
      }
    }

    @-webkit-keyframes pulsate-fwd {
      0% {
        -webkit-transform: scale(1);
        transform: scale(1);
      }

      50% {
        -webkit-transform: scale(1.1);
        transform: scale(1.1);
      }

      100% {
        -webkit-transform: scale(1);
        transform: scale(1);
      }
    }

    @keyframes pulsate-fwd {
      0% {
        -webkit-transform: scale(1);
        transform: scale(1);
      }

      50% {
        -webkit-transform: scale(1.1);
        transform: scale(1.1);
      }

      100% {
        -webkit-transform: scale(1);
        transform: scale(1);
      }
    }
  </style>
</head>
